import ProductCard from "../ProductCard/ProductCard";
import { HomeContainer} from "./homeStyle";


const Home = (props) => {

    return (
      <HomeContainer>
      <ProductCard
      ProductList={props.ProductList}
      addToCart={props.addToCart}
      />
        </HomeContainer>

    );
};

export default Home;
